import React from "react"

const Navbar = (props) =>{
    const response = props.response.data;
    console.log(response);
    let count=0;
    for(let i=0;i<response.data.result.length;i++){
      if(response.data.result[i].verdict==="OK"){
        count+=1;
      }
    }
    console.log(count);
    
    return(
        <div>
            {response.result[0].id}
        </div>
    )



}

export default Navbar
